// Navbar.jsx
import React from 'react';

const NavbarB = () => {
  return (
    <div>
      <nav className="p-4 ">
        <button className="border rounded-lg text-black px-4 py-2 mr-2 hover:bg-gray-200">Streaming</button>
        <button className="border rounded-lg text-black px-4 py-2 mr-2 hover:bg-gray-200">Genre</button>
        <button className="border rounded-lg text-black px-4 py-2 mr-2 hover:bg-gray-200">Batch</button>
      </nav>
      <footer className="bg-gray-800 p-4 text-white text-center">
        <p>&copy; 2023 Your Website Name</p>
        <p>Website Description: Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        <p>Contact Us: example@example.com | Phone: (123) 456-7890</p>
      </footer>
    </div>
  );
};

export default NavbarB;
